#include<bits/stdc++.h>

using namespace std;

#define mp make_pair
#define pb push_back
#define xx first
#define yy second

typedef long long ll;
typedef pair<int,int> pii;

const char pp[] = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789"; 
const char tbl[] = ""; 
const int N = 10010; 
vector < pii > p[N]; 
int tot, fa[N], l[N], irt[N], sz[N], cnt[N], rt[N]; 
ll ans; 
void dfs(int x) { 
	for (pii t : p[x]) { 
		dfs(t.xx); 
		ans += (ll) t.yy * min(sz[t.xx], tot - sz[t.xx]); 
		sz[x] += sz[t.xx]; 
	} 
} 
int main() { 
	const int n = 9318; 
	int u = 0; 
	for (int i = 1; i <= n; i ++) { 
		int t = 0; 
		while (tbl[u] != pp[t]) t ++; 
		if (t == 0) fa[i] = 0; 
		else fa[i] = i - t; 
		u ++; 
		int a = tbl[u] - 97, b = tbl[u + 1] - 97, c = tbl[u + 2] - 97; 
		if (c < 0) c += 97 - 65, irt[i] = 1; 
		l[i] = a + b * 26 + c * 26 * 26; 
		p[fa[i]].pb(mp(i, l[i])); 
		u += 3; 
	} 
	rt[1] = 0; 
	int ma = 1; 
	for (int i = 1; i <= n; i ++) if (irt[i]) { 
		rt[++ ma] = i; 
	} 
	scanf("%d", & tot); 
	for (int i = 1; i <= tot; i ++) { 
		int x; 
		scanf("%d", & x); 
		x = rt[x]; 
		sz[x] ++, cnt[x] ++; 
	} 
	dfs(0); 
	printf("%lld\n", ans); 
}